import React,{Component} from 'react';

class Index extends Component{
    render(){
        return(
            <div>
                <center>
                <div className="btn-group btn-group-lg homebtns" role="group" aria-label="Basic example">
                    <a href="registercomplaint.php"><button type="button" className="btn btn-lg btn-secondary">Register a Complaint</button></a>
                    <a href="Login/firlogin.html"><button type="button" className="btn btn-lg btn-secondary">Check your FIR Status</button></a>
                    <a href="Login/login.html"><button type="button" className="btn btn-lg btn-secondary">Login</button></a>
                </div>
            </center>
            </div>
        );
    }
}

export default Index;
